con:config.script:
def result = ""
def testcases = testRunner.testCase.testSuite.getTestCaseList();


//mcsvEnv se setea desde el plugin soapui de maven para las pruebas nightbuild de jenkins
if (testRunner.testCase.testSuite.project.getPropertyValue("mcsvEnv") != "" &&
	testRunner.testCase.testSuite.project.getPropertyValue("mcsvEnv") != null) {
	result = testRunner.testCase.testSuite.project.getPropertyValue("mcsvEnv")
	//reult = testRunner.testCase.testSuite.getPropertyValue("mcsvEnv")
	log.info("SE SETEA RESULT CON EL VALOR FIJADO EN MAVEN: " + result)	
} else {
	result = com.eviware.soapui.support.UISupport.prompt("Seleccione entorno", "Entorno", ['DESARROLLO DIRECT',  'DESARROLLO ZUUL', 'DESARROLLO API',  'PRODUCCION', 'LOCAL']);
}



log.info "Entorno fijado: " + result

def endpoint = 'http://msv-liveconfig.ont.es:51200/';
def endpointLocal =  'http://localhost:51200/'
def endpointDesa = 'http://msv-liveconfig.ont.es:51200/';
def endpointDesaZuul = 'http://msv-netflix.ont.es:51040/test-component';
def endpointDesaApi = 'http://msv-liveconfig.ont.es:51200';
def endpointProd = '';


if (result == 'LOCAL') {
	endpoint = endpointLocal;
	log.info "se fija endpoint para pruebas en local: " + endpoint
}

if (result == 'DESARROLLO DIRECT') {
	endpoint = endpointDesa;
	log.info "se fija endpoint para pruebas en desarrollo: " + endpoint
}
if (result == 'DESARROLLO ZUUL') {
	endpoint = endpointDesaZuul;
	log.info "se fija endpoint para pruebas en Zuul: " + endpoint
}
if (result == 'DESARROLLO API') {
	endpoint = endpointDesaApi;
	log.info "se fija endpoint para pruebas en desarrollo API: " + endpoint
}

if (result == 'PRODUCCION') {
	endpoint = endpointProd;
	log.info "se fija endpoint para pruebas en produccion: " + endpoint
}

if (result != null) {
	log.info ('test entorno ' + result)
	testcases.each { testcase ->
		def teststeps = testcase.getTestStepList();
		teststeps.each { teststep ->
			teststep.setPropertyValue('endpoint', endpoint);
		}
	}
} else {
	log.info ('test cancelado')
	def tsr =  context.getProperty( "#TestSuiteRunner#" )
	if( tsr != null ) tsr.cancel( "Ejecucion cancelada" )
}
